let Card=()=>{
    return(
        <>
            <div className="container">
                <h1 className="heading">ToDo List</h1>
                <div className="add-list">
                <input type="text" placeholder="Add a Item"/>
                <button className="btn">Add</button>
                </div>
                
            </div>
            
        </>
    )
}
export default Card;
